const Hello = (props) => {
  return (
    <div>
      <p>Damn shawty, have you seen {props.name}? She's gone for {props.n} weeks.</p>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name='George' n='2'/>
      <Hello name='Daisy' />
    </div>
  )
}

export default App
